// SPDX-License-Identifier: MIT

pragma solidity 0.8.13;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

import "./Authorizable.sol";
import "./IvEvoToken.sol";

/**
 * @author EvoVerses
 * @title claimVEvoToken
 */

/*
 * This contract allows whitelisted addresses to claim vEVO token (vested version of the EVO token).
 * They will be able to claim only the allowed amount.
 */

contract claimVEvoToken is Ownable, Authorizable, ReentrancyGuard {
    // Structs
    struct User {
        uint256 amount;
        bool valid;
    }
    //

    IERC20 private _vEvoToken;
    mapping(address => User) public userClaimable;
    bool public isClaimEnabled;
    bool isInitialized;
    uint256 public totalClaimedTokens;
    // Probably not necessary
    bool public isWhitelistInitialized;

    // Events
    event UpdateUserClaimable(address indexed addr, uint256 amount);
    event UpdateTokenClaimEvent(bool status);
    event UserClaimedTokens(address indexed addr, uint256 amount);
    event UpdateTotalClaimedTokens(uint256 amount);
    //

    // Modifiers
    modifier onlyWhitelisted() {
        require(
            userClaimable[msg.sender].valid == true,
            "User is not from the private sale!"
        );
        _;
    }

    modifier hasTokensLeft() {
        require(
            userClaimable[msg.sender].amount > 0,
            "User has not claimable tokens left!"
        );
        _;
    }

    modifier onlyWithClaimEnabled() {
        require(isClaimEnabled == true, "Token claim is not started!");
        _;
    }

    modifier onlyIfNoInitialized() {
        require(isInitialized == false, "Contract already initialized!");
        _;
    }

    modifier onlyIfInitialized() {
        require(isInitialized == true, "Contract is not initialized!");
        _;
    }

    //

    constructor() Ownable() {
        isInitialized = false;
    }

    function initialize(IERC20 vEvoToken)
        public
        onlyAuthorized
        onlyIfNoInitialized
    {
        _vEvoToken = vEvoToken;
        isWhitelistInitialized = false;
        isClaimEnabled = false;
        totalClaimedTokens = 0;
        _initializeWhitelist();
        isInitialized = true;
    }

    function enableTokenClaimEvent() public onlyIfInitialized onlyAuthorized {
        isClaimEnabled = true;
        emit UpdateTokenClaimEvent(true);
    }

    function disableTokenClaimEvent() public onlyIfInitialized onlyAuthorized {
        isClaimEnabled = false;
        emit UpdateTokenClaimEvent(false);
    }

    function hasClaimable()
        public
        view
        onlyIfInitialized
        onlyWithClaimEnabled
        returns (uint256)
    {
        address _user = msg.sender;
        uint256 _retAmount = 0;

        if (userClaimable[_user].valid) {
            return userClaimable[_user].amount;
        }

        return _retAmount;
    }

    function claim()
        public
        onlyIfInitialized
        onlyWithClaimEnabled
        onlyWhitelisted
        hasTokensLeft
        nonReentrant
    {
        // If we enter here, the user is whitelisted and has tokens left and the claim event is running
        address _user = msg.sender;
        uint256 _claimableAmount = userClaimable[_user].amount;
        userClaimable[_user].amount = 0;
        totalClaimedTokens = totalClaimedTokens + _claimableAmount;
        emit UpdateTotalClaimedTokens(totalClaimedTokens);
        IvEvoToken(address(_vEvoToken)).mintTokenFor(_user, _claimableAmount);
        emit UserClaimedTokens(_user, _claimableAmount);
    }

    function addToWhitelist(address addr, uint256 amount)
        external
        onlyIfInitialized
        onlyAuthorized
    {
        // We probably should enter more validations here but since it will be run only by the owner...
        if (userClaimable[addr].valid) {
            // We have already whitelisted this one, but we might increase its whitelisted amount
            userClaimable[addr].amount = userClaimable[addr].amount + amount;
        } else {
            // The user is not in the whitelist
            userClaimable[addr] = User(amount, true);
        }
        emit UpdateUserClaimable(addr, userClaimable[addr].amount);
    }

    function removeFromWhitelist(address addr, uint256 amount)
        external
        onlyIfInitialized
        onlyAuthorized
    {
        // We probably should enter more validations here but since it will be run only by the owner...
        require(
            userClaimable[addr].valid == true,
            "User is not in the whitelist!"
        );

        // User is in the whitelist!
        if (amount > userClaimable[addr].amount) {
            userClaimable[addr].amount = 0;
        } else {
            userClaimable[addr].amount = userClaimable[addr].amount - amount;
        }
        emit UpdateUserClaimable(addr, userClaimable[addr].amount);
    }

